import React from 'react';
import ReactDOM from 'react-dom';

class Product extends React.Component {
    render() {
        return (
            <div>
                <div>
                    {this.props.face}
                </div>
                <div>
                    {this.props.size} pixels
                    ${this.props.price / 100}
                </div>
                <div>
                    {this.props.date}
                </div>
            </div>
        );
    }

}

export default Product;
